import logo from "./logo.svg";
import "./App.css";

function App() {
  const expenseItem = new Date(2021, 2, 28);
  const expensetITLE = "Car Insurence";
  const expenseAmount = 294.76;

  return (
    <div className="expens-item">
      <div>{expenseItem.toISOString()}</div>
      <div className="expens-item-description">
        <h2>{expensetITLE}</h2>
        <div className="expens-item-price">{expenseAmount}</div>
      </div>
    </div>
  );
}
export default App;
